import React, { Component } from 'react';
import 'Header.css';

const NavigationBar = () => {
    return (
        <nav>
            <h1>test</h1>
        </nav>
    );
}

class Header extends Component {

    render(){
        return(
            <header>
                <NavigationBar />
            </header>
        );
    }
}

export default Header;
